import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './common/css/index.css'
import {Provider} from "react-redux";

import {Route,BrowserRouter,Switch} from "react-router-dom";
ReactDOM.render(
    <BrowserRouter>
        <Provider>
            <App />
        </Provider>

    </BrowserRouter>
    ,
    document.getElementById('root')
);
